import React from 'react';
import './App.css';
import {BrowserRouter, Switch,Route ,NavLink } from 'react-router-dom';
import Login from './Login';
import Register from './Register';



function App() {
  return (
    <div className="App">

      <BrowserRouter>

      <NavLink  exact className="active" to="/login"> Login <small>aSHONOICANOIC</small> </NavLink>
      <NavLink  exact className="active" to="/register"> Register</NavLink>
     <div> 
        <Switch >
          <Route  exact path='/login' component={Login}/>
    <Route  exact path='/register' component={Register}/>
    </Switch >

    </div>
     </BrowserRouter>
    </div>
  );
}

export default App;
